:"nan"},"bottom":{"type":"number","value":"nan"},"left_units":"canvas","right_units":"canvas","top_units":"canvas","bottom_units":"canvas","handles":{"type":"object","name":"BoxInteractionHandles","id":"p215973","attributes":{"all":{"type":"object","name":"AreaVisuals","id":"p215972","attributes":{"fill_color":"white","hover_fill_color":"lightgray"}}}}}}}},{"type":"object","name":"SaveTool","id":"p215974"},{"type":"object","name":"ResetTool","id":"p215975"},{"type":"object","name":"HelpTool","id":"p215976"}]}},"toolbar_location":"above","left":[{"type":"object","name":"LinearAxis","id":"p215959","attributes":{"ticker":{"type":"object","name":"BasicTicker","id":"p215960","attributes":{"mantissas":[1,2,5]}},"formatter":{"type":"object","name":"BasicTickFormatter","id":"p215961"},"axis_label":"Probability Density","major_label_policy":{"type":"object","name":"AllLabels","id":"p215962"}}},{"type":"object","name":"Legend","id":"p215986","attributes":{"location":"top_left","click_policy":"hide","items":[{"type":"object","name":"LegendItem","id":"p215987","attributes":{"label":{"type":"value","value":"Observed"},"renderers":[{"id":"p215983"}]}},{"type":"object","name":"LegendItem","id":"p215997","attributes":{"label":{"type":"value","value":"LSTM Ensemble"},"renderers":[{"id":"p215994"},{"id":"p216004"},{"id":"p216013"},{"id":"p216022"},{"id":"p216031"},{"id":"p216040"},{"id":"p216049"},{"id":"p216058"},{"id":"p216067"},{"id":"p216076"}]}},{"type":"object","name":"LegendItem","id":"p216088","attributes":{"label":{"type":"value","value":"POR Observed"},"renderers":[{"id":"p216085"}]}},{"type":"object","name":"LegendItem","id":"p216098","attributes":{"label":{"type":"value","value":"timeEnsemble"},"renderers":[{"id":"p216095"}]}},{"type":"object","name":"LegendItem","id":"p216108","attributes":{"label":{"type":"value","value":"distEnsemble"},"renderers":[{"id":"p216105"}]}},{"type":"object","name":"LegendItem","id":"p216118","attributes":{"label":{"type":"value","value":"LN_MLE"},"renderers":[{"id":"p216115"}]}},{"type":"object","name":"LegendItem","id":"p216128","attributes":{"label":{"type":"value","value":"LN_PredictedLog"},"renderers":[{"id":"p216125"}]}},{"type":"object","name":"LegendItem","id":"p216138","attributes":{"label":{"type":"value","value":"LN_PredictedMOM"},"renderers":[{"id":"p216135"}]}},{"type":"object","name":"LegendItem","id":"p216148","attributes":{"label":{"type":"value","value":"KNN_2_NN"},"renderers":[{"id":"p216145"}]}},{"type":"object","name":"LegendItem","id":"p216158","attributes":{"label":{"type":"value","value":"KNN_4_NN"},"renderers":[{"id":"p216155"}]}},{"type":"object","name":"LegendItem","id":"p216168","attributes":{"label":{"type":"value","value":"KNN_8_NN"},"renderers":[{"id":"p216165"}]}}]}}],"below":[{"type":"object","name":"LogAxis","id":"p215954","attributes":{"ticker":{"type":"object","name":"LogTicker","id":"p215955","attributes":{"num_minor_ticks":10,"mantissas":[1,5]}},"formatter":{"type":"object","name":"LogTickFormatter","id":"p215956"},"axis_label":"Unit Area Runoff (L/s/km2)","major_label_policy":{"type":"object","name":"AllLabels","id":"p215957"}}}],"center":[{"type":"object","name":"Grid","id":"p215958","attributes":{"axis":{"id":"p215954"}}},{"type":"object","name":"Grid","id":"p215963","attributes":{"dimension":1,"axis":{"id":"p215959"}}}]}}]}},{"type":"object","name":"Row","id":"p216944","attributes":{"children":[{"type":"object","name":"Div","id":"p216940","attributes":{"width":1000,"text":"\n&lt;h2&gt;Notes:&lt;/h2&gt;\n&lt;p style=\"margin-left:10px;\"&gt;\n&lt;h3&gt;Methods:&lt;/h3&gt;\n&lt;strong&gt;timeEnsemble&lt;/strong&gt;: Temporally-averaged LSTM ensemble.&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;distEnsemble&lt;/strong&gt;: Distribution-averaged LSTM ensemble.&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;LN&lt;sub&gt;MLE&lt;/sub&gt;&lt;/strong&gt;: Log-normal distribution fitted by maximum likelihood to observed data&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;LN&lt;sub&gt;PredictedLog&lt;/sub&gt;&lt;/strong&gt;: Log-normal distribution using predicted log-mean \\( \\mu \\) and log-standard deviation \\( \\sigma \\), i.e., parameters of \\( \\log Q \\sim \\mathcal{N}(\\mu, \\sigma^2) \\).&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;LN&lt;sub&gt;PredictedMOM&lt;/sub&gt;&lt;/strong&gt;: Log-normal distribution using predicted mean and standard deviation of \\( Q \\), with parameters estimated by method of moments.&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;KNN&lt;/strong&gt;: Attribute-based ensemble estimate using average distribution from the 2 and 8 nearest neighbors (2/8-NN) selected by similarity in catchment attributes.&lt;br&gt;&lt;br&gt;\n&lt;h3&gt;Performance Measures&lt;/h3&gt;\n&lt;strong&gt;RMSE&lt;/strong&gt;: Root Mean Square Error, \\( \\sqrt{ \\frac{1}{N} \\sum_{t=1}^{N} \\left( Q_{\\text{sim}}(t) - Q_{\\text{obs}}(t) \\right)^2 } \\)&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;VE&lt;/strong&gt;: Volume Efficiency, \\( 1 - \\frac{ \\left| \\sum Q_{\\text{sim}} - \\sum Q_{\\text{obs}} \\right| }{ \\sum Q_{\\text{obs}} } \\)&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;PMF/FDC&lt;sub&gt;Volume Bias&lt;/sub&gt;&lt;/strong&gt;: Relative bias in expected flow from estimated PMFs/FDCs, \\( \\frac{ \\mathbb{E}[Q_{\\text{sim}}] - \\mathbb{E}[Q_{\\text{obs}}] }{ \\mathbb{E}[Q_{\\text{obs}}] } \\)&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;RE&lt;/strong&gt;: Relative error, computed as \\( \\frac{F_{\\text{sim}}(p) - F_{\\text{obs}}(p)}{F_{\\text{obs}}(p)} \\), where \\( F(p) \\) denotes the duration curve (FDC) for exceedance duration \\(p\\).&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;NSE&lt;/strong&gt;: Nash\u2013Sutcliffe Efficiency, defined as \\( 1 - \\frac{\\sum (Q_{\\text{sim}} - Q_{\\text{obs}})^2}{\\sum (Q_{\\text{obs}} - \\bar{Q}_{\\text{obs}})^2} \\). Values closer to 1 indicate better performance.&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;KGE&lt;/strong&gt;: Kling\u2013Gupta Efficiency, combining correlation, variability, and bias:&lt;br&gt;\n\\( \\quad \\mathrm{KGE} = 1 -\\ \\sqrt{(r - 1)^2 + (\\alpha - 1)^2 + (\\beta - 1)^2} \\)&lt;br&gt;\n\\(\\quad\\)&lt;strong&gt;r&lt;/strong&gt;: Pearson correlation; &lt;strong&gt;\u03b1&lt;/strong&gt;: ratio of standard deviations \\( \\left( \\frac{\\sigma_{\\text{sim}}}{\\sigma_{\\text{obs}}} \\right) \\); &lt;strong&gt;\u03b2&lt;/strong&gt;: bias ratio \\( \\left( \\frac{\\mu_{\\text{sim}}}{\\mu_{\\text{obs}}} \\right) \\)&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;KLD&lt;/strong&gt;: Kullback\u2013Leibler divergence between observed and simulated distributions:&lt;br&gt;\n\\( \\quad D_{\\mathrm{KL}}(P \\parallel Q) = \\sum P(x) \\log \\left(\\frac{P(x)}{Q(x)}\\right) \\)&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;EMD&lt;/strong&gt;: Sum of absolute differences between cumulative distributions: \\( \\mathrm{EMD}(P, Q) = \\sum_x \\left| \\mathrm{CDF}_P(x) - \\mathrm{CDF}_Q(x) \\right| \\)\n&lt;/p&gt;\n"}}]}}]}}]}}
